         <Route path="/shirt_somi" exact render={props => <Shirt {...props} link="/shirt1_somi" Name="Áo Sơ Mi" />} />
         <Route path="/trouser" exact render={props => <Shirt {...props} link="/trouser1" Name="Quần" />}/>
         <Route path="/trouser_sooc" exact render={props => <Shirt {...props} link="/trouser1_sooc" Name="Quần Sooc" />} />
         <Route path="/trouser_jean" exact render={props => <Shirt {...props} link="/trouser1_jean" Name="Quần Jean" />} />
         <Route path="/trouser_baggy" exact render={props => <Shirt {...props} link="/trouser1_baggy" Name="Quần Baggy" />} />
         <Route path="/vay" exact render={props => <Shirt {...props} link="/vay1" Name="Váy"  />}/>
         <Route path="/vay_dam" exact render={props => <Shirt {...props} link="/vay1_dam" Name="Váy Đầm" />}/>
         <Route path="/Vay_jum" exact render={props => <Shirt {...props} link="/vay1_jum" Name="Váy JUM" />}/>
         <Route path="/vay_yem" exact render={props => <Shirt {...props} link="/vay1_yem" Name="Quần" />}/>
        <Route path="/shirt/aaa"  component={Products} />
        <Route path="/:name"  component={Products} />
      </Switch>

    </Router>
  );
}}

